        //    </div>
        //   )}



        // </div>

        <Topwrapper> 
          <Logo>Mapwith</Logo>
          {user ?(
          <>
          <Button  variant="text"   onClick={handleSubmit}>Logout</Button>
          <Button sx={styles} variant="text"   onClick = {() => history.push(`/create-countries`)}>Create Country List!!</Button>
          </>
          ):(
          <Icon>
            <Linkedin>
              <NavLink to={`/countries/login`}>
              Login
              </NavLink>
            </Linkedin>

            <Airbnb>
              <NavLink to={`/countries/signup`}>
              SignUp
              </NavLink>
            </Airbnb>
          </Icon>
          )}
        </Topwrapper> 


    );
}

export default Navbar


